      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE + 8 NOT IN ( ( - col2 ) + + + 68 / - col1 - + 94, 15 + - 87 - - col2 / - + 14 * col0 );
  - name: tab0

outputs:
